import styled from 'styled-components';

const LayoutTitle = styled.div`
  color: #333740;
  font-size: 13px;
  font-weight: 500;
  line-height: 18px;

  p {
    margin-top: 2px;
    margin-bottom: 13px;
    color: #9ea7b8;
    font-size: 12px;
    font-weight: 400;
    line-height: normal;
  }
`;

export default LayoutTitle;
